import express from 'express';
const router = express.Router();
import {
    Nutrient,
    Ingredient,
    IngredientNutrient
} from "../../database/models";

/**
 * Made by Heo In
 * 2019.10.21
 * Nutrient
 * Ingredient의 Nutrient를 받아온다
 *
 * GET /api/nutrient/ingredient/:id
 * Param : { id: 50 }
 *
 * Error Code
 *      1: BAD ID
 *
 */
router.get('/ingredient/:id', (req, res) => {
    let numberRegex = /[^0-9]/g;
    if(numberRegex.test(req.params.id)) {
        return res.status(400).json({
            error: "BAD ID",
            code: 1
        });
    }
    Ingredient.findOne({
        attributes: ['name'],
        include: [{
            model: Nutrient,
            attributes: ['name_kor', 'unit'],
            through: {
                model: IngredientNutrient,
                attributes: ['nutrient_amount']
            }
        }],
        where: {id: req.params.id}
    }).then(result => {
        res.json(result);
        return res.status(200);
    }).catch(err => {
        console.log(err);
    })
});

/**
 * Made by Heo In
 * 2019.10.21
 * Nutrient
 * Ingredient의 Nutrient를 받아온다
 *
 * GET /api/nutrient/ingredient/:id/:type
 * Param : { id: 50, type: 1 }
